import "../styles/method.css";
import { React, useState } from "react";

export const Search = (props) => {
  const riceDataSort = () => {
    fetch(`${URL}/table`, { method: "GET" })
      .then((res) => res.json())
      .then((getData) => {
        allMenuSet(getData.filter(props.category === "ごはん"));
      });
  };

  return (
    <>
      <button id="rice" onClick={riceDataSort}>
        ごはん
      </button>
      <button>パスタ</button>
    </>
  );
};
